    def clr(self):
        val = self.lineEdit.text()
        self.lineEdit.setText("")

    def dell(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val[:len(val) - 1])

    def one(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "1")

