    def zero(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "0")

    def square(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(str((eval(val) ** 2)))

    def fraction(self):
        val = self.lineEdit.text()
        self.a = (1 / (eval(val)))
        self.lineEdit.setText(str(self.a))

    def absolute(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(str((abs(eval(val)))))

    def mod(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "%")

    def equals(self):
        val = self.lineEdit.text()
        try:
            self.lineEdit.setText(str(eval(val)))
        except:
            self.lineEdit.setText("1")

    def sqRoot(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(str((math.sqrt(eval(val)))))

    def Factorial(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(str(int(math.factorial(eval(val)))))

    def addi(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "+")

    def minus(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "-")

    def multiplication(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "*")

    def div(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + "/")

    def decimal(self):
        val = self.lineEdit.text()
        self.lineEdit.setText(val + ".")

    def Ten_power(self):
        val = self.lineEdit.text()
        self.p = math.pow(10, eval(val))
        self.lineEdit.setText(str(self.p))

    def loga(self):

        val = self.lineEdit.text()
        self.p = math.log10(eval(val))
        self.lineEdit.setText(str(self.p))

